import React from 'react';
import {
    ResponsiveContainer,
    LineChart,
    Line,
    XAxis,
    CartesianGrid,
    Tooltip,
} from 'recharts';

//import formatCurrency from '../../utils/formatCurrency';

import { 
    Container, 
    ChartContainer,
    Header,
    LegendContainer,
    Legend,
}  from './styles';


interface IHistoryBoxProps {
    data: {
        year: string;
        amountChanged: number;
    }[],
    lineColorAmountChanged: string;
}

const HistoryBox: React.FC<IHistoryBoxProps> = ({
    data, lineColorAmountChanged
}) => (
    <Container>
        <Header>
            <h2>General growth since 2008</h2>
            <LegendContainer>
                <Legend color={lineColorAmountChanged}>
                    <div></div>
                    <span>General growth</span>
                </Legend>
           
            </LegendContainer>
        </Header>

        <ChartContainer>
           

            <ResponsiveContainer width="100%" height="100%">
        <LineChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="pv" stroke="#8884d8" activeDot={{ r: 8 }} />
          <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
        </LineChart>
      </ResponsiveContainer>
        </ChartContainer>
    </Container>
)

export default HistoryBox;
